import React from 'react';

const Calulate = ({onSelectedVehicle}) => {
  console.log('Calulate')
  return (
    <div className="missioncontroll_cal">
      <div className="missioncontroll_cal-box">
        <span className="missioncontroll_cal-label">
          Time taken :
        </span>
        <span className="missioncontroll_cal-result" onSelectedVehicle={onSelectedVehicle}>

        </span>
      </div>
    </div>
  );
}

export default Calulate;
